import react, {Component} from 'react';

class Banner extends Component {

  render () {
    return (
      <div>
        <a
         class="twitter-timeline"
          href="https://twitter.com/home?ref_src=twsrc%5Etfw"
        >Tweets by home</a>
        <script 
          src="https://platform.twitter.com/widgets.js"
          charset="utf-8">
        </script>
      </div>
    );
  }
}

export default Banner;
